[{"location":"","page":"Home","title":"Home","text":"CurrentModule = Network_qse","category":"page"},{"location":"#Network_qse.jl-Documentation","page":"Home","title":"Network_qse.jl Documentation","text":"","category":"section"},{"location":"#Index","page":"Home","title":"Index","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Network_qse]","category":"page"},{"location":"#Network_qse.AtomicProperties","page":"Home","title":"Network_qse.AtomicProperties","text":"AtomicProperties\n\nStores all physical properties of an  element with charge number Z and atomic  number Z. Mass in units of MeV with conversion factor: M * [meverg] / c^2 = [erg]\n\n\n\n\n\n","category":"type"},{"location":"#Network_qse.MultiNewtonRaphson-Tuple{Array{T,1} where T,Any,Any,Any,Any}","page":"Home","title":"Network_qse.MultiNewtonRaphson","text":"MultiNewtonRaphson(x::Vector, T, rho, y, ap)\n\n[-7.0010491,-9.1] ∂/∂xᵢ [f₁,...,fₙ] good guess: [-4.394094904641707, -12.915712928215058]\n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.df_nse_condition-NTuple{5,Any}","page":"Home","title":"Network_qse.df_nse_condition","text":"df_nse_condition!(J,μ, T,rho, ap)\n\ncomputes Jacobian ∇f ∈ ℝ²×ℝ² with f ∈ ℝ², μ ∈ ℝ² Contains all 4 partial derivates with respect to the  proton and neutron chemical potentials. \n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.extract_partition_function-Tuple{}","page":"Home","title":"Network_qse.extract_partition_function","text":"extract_partition_function()\n\nReturns N dimensional struct with given  physical quantities from input files. Checks for indentical charge number Z and atomic numbers A in \"massfrdm\" and \"partfrdm\". Interpolates partition function ω(T).\n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.initial_guess-Tuple{Any}","page":"Home","title":"Network_qse.initial_guess","text":"initial_guess(ap_ni56)\n\nindex: 438 or 863 or 762 inverse of saha equation with only one species and μₚ = μₙ. returns μ.  We assume that the gas is only composed of Nickel 56 and then solve the Saha Equation for the chemical potentials of Protons and neutrons (which we assume as equal). \n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.logsumexp-Tuple{Any}","page":"Home","title":"Network_qse.logsumexp","text":"logsumexp(arr)\n\nmax + log(sum(exp{arr - max})) instead of log(sum(exp(arr)))\n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.nse_condition-Tuple{Any,Real,Real,Real,Any}","page":"Home","title":"Network_qse.nse_condition","text":"nse_condition!(res, μ, T, ρ, y, ap; precision=400)\n\nreturns zero function, as obtained from condition of  mass conservation and charge neutrality for NSE:\n\nlog (∑ᵢXᵢ) = 0 \nlog(∑ᵢ(Zᵢ/Aᵢ)Xᵢ / y) = 0\n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.prefactor-Tuple{Any}","page":"Home","title":"Network_qse.prefactor","text":"prefactor(pf)\n\nreturns prefactor of Xi, as given in http://cococubed.asu.edu/codepages/nse.shtml The physical quantities to compute theBoltzmann  prefactor  for a given element are temperature,  density (which are varied),  mass and atomic number.\n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.read_mass_frdm-Tuple{}","page":"Home","title":"Network_qse.read_mass_frdm","text":"read_mass_frdm()\n\nread ground state energies\n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.read_part_frdm-Tuple{}","page":"Home","title":"Network_qse.read_part_frdm","text":"read_part_frdm()\n\nreads in follwing files: \"mass-frdm95.dat\" with the ground state properties based  on the FRDM model Format PIA: ADDED partition functions and A,Z,s for n,p,d,T,3He\n\n\n\n\n\n","category":"method"},{"location":"#Network_qse.read_species-Tuple{}","page":"Home","title":"Network_qse.read_species","text":"read_species()\n\nreads species from table\n\n\n\n\n\n","category":"method"},{"location":"#Notes","page":"Home","title":"Notes","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This layout should be customized in docs/src/index.md","category":"page"}]
